import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
        <Routes>
          <Route exact path="/">
            hello world
          </Route>
        </Routes>
    </Router>
  );
}

export default App;
